Ext.define('Tweamy.view.ImageGallery', {
    extend: 'Ext.Panel',
	alias: ['widget.imageGallery'],
	
    xtype: 'imageGallery',

    config: {
		
	    modal: true,
	    hideOnMaskTap: true,
	    centered: true,
		width: 600,
		height: 300,
		autoDestroy: true,
		
		imageTag: '',
		
		items: [
			{
                xtype: 'toolbar',
				id: 'imageGalleryToolbarlId',
                docked: 'top',
				title: 'Beschikbare afbeeldingen'
			},
			{
                //give it an xtype of list for the list component
                xtype: 'dataview',
                id: 'imageGalleryDataviewId',
				height: 205,
                scrollable: 'horizontal',
                inline: {
                    wrap: false
                },

	            listeners: {
		            itemtap: function(list, index, item, rec) {
		                Ext.getCmp(this.up('panel').getImageTag()).setSrc(rec.get('photo'));
		            }
				},
                //set the itemtpl to show the fields for the store
                itemTpl: '<div class="imgGallery"><img src="{photo}"><br><p>{photoName}</p></div>',
            }
		]
    },
	
	applyImageTag: function (b) {
		return b;
	},
	
	initialize: function () {
		this.callParent();
		
        Ext.define('imageGalleryModel', {
            extend: 'Ext.data.Model',
            config: {
                fields: ['photo', 'photoName']
            }
        });

        var store = Ext.create('Ext.data.Store', {
	        autoLoad: true,
	        autoSync: true,
            model: 'imageGalleryModel',
			storeId: 'imageGalleryStore',
			
            data: [
				{ photo: 'data:image/png;base64,',
				photoName: 'Peter Griffin'	},
				{ photo: 'data:image/png;base64,',
				photoName: 'Lois Griffin'	},
				{ photo: 'data:image/png;base64,',
				photoName: 'Stewie Griffin'	},
			]
        });
		var tmp = Ext.ComponentQuery.query('#imageGalleryDataviewId')[0];
		tmp.setStore(store);
		
	}
});